import React from 'react';
import '../../assets/css/videos/videos.css';

const CardImage = (props) => {
    const { image, title, detail } = props;
    return (
        <div className="card videoCard">
            <img
                className='card-videos-small-as-title'
                src={image}
                alt="noImage" />

            <div className="card-body p-2">
                <span className='card-video-title-text'>
                    {title}
                </span><br />

                <span className='card-videos-body-text'>
                    {detail}
                </span>
            </div>
        </div>
    );
}

export default CardImage;
